    value: 'Dear Brian, I am in receipt of the two letters dated January 30, 2014
      identifying errors in properly identifying the elections for several campaign
      contributions.  Pursuant to your inquiry, we have amended both the October Quarterly
      Report and the Year End report to reflect corrected information.  With regard
      to the October Quarterly report, the amended report has re-designated the September
      9, 2013 contribution to Friends of Jeanne Shaheen from the primary to the general
      election for 2014.  Additionally, the amended report has split the September
      13, 2013 contribution to Friends of Pat Toomey to designate $1,000 towards the
      2016 primary election and $1,000 towards the 2016 general election.  We have
      confirmed these changes with the respective campaigns.  With regard to the Year
      end report, we had erred and had exceeded the contribution limits for the McConnell
      Senate Committee 2014.  This mistake was brought to our attention by the campaign
      committee.  Indeed, they identified that we had exceeded the limit by $500.00
      in a check written April 5, 2013.  This sum was refunded.  This refund is properly
      recorded in our amended Year End report. Second issues: They did not deposit
      check written on 12/11 13 for $5,000.00, check was returned.  12/11/13 check
      to Friends of Schumer, contribution split $3,000 to primary & $2,000 to general
      election.  Changes made to year end report.

